import React, { useState } from "react";
import '../styles/sections/Brandinfluencerbox.css'
import { useEffect } from "react";
import axios from 'axios'
import Createboxpopup from "../snippets/Createboxpopup";


function Brandinfluencerbox(props) {

    const [boxpopup, setBoxpopup] = useState(false)
    const [boxlist, setBoxlist] = useState()

    useEffect(() => {
        axios.get(`${process.env.REACT_APP_ROUTE}/api/brand/getprofile`, {
            params: {
                id: props.id
            }
        }).then((res) => {
            setOldprofile(res.data.user_profile.profile_picture)
            setProfile(res.data.user_profile.profile_picture)
            setBrandname(res.data.user_profile.brandname)
            setEmail(res.data.user_profile.email)
        }).catch(err => alert(err))
    }, [])

    return (
        <div className="brandinfluencerbox-main-container">
            <div className="brandinfluencerbox-action-bar">
                <button onClick={() => (setBoxpopup(true))} className="affiliateprofile-button-one">Create Box</button>
            </div>
            <div className="brandinfluencerbox-table-container">
                <table className="brandinfluencerbox-table">
                    <thead>
                        <tr>
                            <th></th>
                            <th><label>LABEL</label></th>
                            <th><label>DESCRIPTION</label></th>
                            <th><label>INFLUENCER COUNT</label></th>
                            <th><label>ACTION</label></th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td></td>
                            <td><span className="">Jonas</span></td>
                            <td>asd</td>
                            <td>asd</td>
                            <td>asd</td>
                        </tr>
                    </tbody>
                </table>
            </div>
            {boxpopup && <Createboxpopup stateChanger={setBoxpopup} Id={props.Id} />}
        </div>
    )
}

export default Brandinfluencerbox
